import './index.scss';
import {setPiechart, setLinechart, formatMoney} from './util.js';
localStorage.setItem('key','data:image/png;base64,')
var picUrl = localStorage.getItem('key');
// 加载失败 图片 
$('.pic>i').css({'background':'url('+picUrl+') no-repeat','background-size': 'contain'});

var isLoading = false;
var hasData = true;

$(document).ready(function(){
    // 获取总盈利
    getProfit();
    getMonthProfit(new Date().pattern('yyyy-MM'));
    initTimeSelector();

    // 点击显示时间选项
    $('.icon-touch').on('touchstart',function(){
        $('.all-layer').addClass('active').css('top', window.scrollY);
        var top = $(this).offset().top - window.scrollY;
        $('.chart-layer-content').addClass('active').css('top', top);
    });
    var hasMoved = false
    // 点击选择时间
    $('.chart-layer .time-item').on('touchend', function(e){
        if(e.type == 'touchmove') hasMoved = true;
        if(e.type == 'touchend'){
            if(hasMoved) {
                hasMoved = false;
                return;
            }
            $(this).addClass('active').siblings().removeClass('active');
            getMonthProfit($(this).attr('value'));
            hasMoved = false;
            $('.all-layer').trigger('touchend');
        }
        
    });
    
    // 数据加载失败 点击加载
	$('.load_btn').on('click',function(){
		var time = $('.chart-layer .time-item.active').text();
		var clickTime = time.substr(0,4)+'-'+time.substr(7,2);
	    var loadingIndex = loading();
	    var userId = getQueryString('userid') || 0;
	    var def = reqAjax('earnmoney/getProfitReport', {
	        userId: userId
	    });
	    def.then(function(data){
	    	$('.content').css({'display':'block'});
	    	$('.fail_load').css({'display':'none'});
	        layer.close(loadingIndex);
	        data.code == 1 ? initProfitData(data.data): toast(data.msg);
	        getMonthProfit(new Date().pattern(clickTime));
	    });
	 
	});


    $('.chart-layer-content').on('touchstart touchmove touchend', function(e){
        e.preventDefault();
        e.stopPropagation();
    });
    // 点击显示提示
    $('.icon-question').on('click',function(){
        $(this).toggleClass('active');
    });

    var categoryMoved = false;
    // 点击显示账单分类
    $('.icon-select.icon-category').on('touchmove touchend',function(e){
        if(e.type == 'touchmove') categoryMoved = true;
        if(e.type == 'touchend'){
            if(categoryMoved) {
                categoryMoved = false;
                return;
            }
            $('.all-layer').addClass('active').css('top', window.scrollY);
            $('.category-layer-content').addClass('active');
            $('.category-content, .icon-category').addClass('active');
            $('.calendar-content, .icon-time').removeClass('active');
        }
    });

    var timeMoved = false;
    // 点击显示账单时间
    $('.icon-select.icon-time').on('touchmove touchend',function(e){
        if(e.type == 'touchmove') timeMoved = true;
        if(e.type == 'touchend'){
            if(timeMoved) {
                timeMoved = false;
                return;
            }
            resetSelectedDate();
            $('.all-layer').addClass('active').css('top', window.scrollY);
            $('.category-layer-content').addClass('active');
            $('.category-content, .icon-category').removeClass('active');
            $('.calendar-content, .icon-time').addClass('active');
        }
    });

    var categoryItemMoved = false;
    // 点击选择账单分类
    $('.category-item').on('touchmove touchend',function(e){
        if(e.type == 'touchmove') categoryItemMoved = true;
        if(e.type == 'touchend'){
            if(categoryItemMoved) {
                categoryItemMoved = false;
                return;
            }
            $(this).addClass('active').siblings().removeClass('active');
            reloadBillList();
            $('.all-layer').trigger('touchend');
            categoryItemMoved = false;
        }
    });

    // 点击选择时间，重新加载账单列表
    $('.date-btn').on('touchend',function(){
        setSelectedDate(true);
        reloadBillList();
        $('.all-layer').trigger('touchend');
    });

    // 点击隐藏层
    $('.all-layer').on('touchend',function(){
        $(this).removeClass('active');
        $('.chart-layer-content, .category-layer-content, .icon-select, .category-content, .calendar-content').removeClass('active');
    });
    // 滚动加载
    $(window).on('scroll', function (){
        // 判断加载条件
        if (isLoading) return;
        if(!hasData) return;
        var needLoad = document.body.offsetHeight - 50 < window.scrollY + window.innerHeight;
        if(!needLoad) return;
        getBillList();
    });
});

// 全局触摸
window.ontouchend = function(){
    $('.icon-question').removeClass('active');
}
// 滚动到顶部或详情
window.onload = function(){
	getBillList();
    setTimeout(() => {
        var todetail = parseInt(getQueryString('todetail')) || 0;
        window.scrollTo(0, (!todetail ? 0 : document.body.offsetHeight));
    }, 150);
}

// 获取各种盈利信息
function getProfit(){
    var loadingIndex = loading();
    var userId = getQueryString('userid') || 0;
    var def = reqAjax('earnmoney/getProfitReport', {
        userId: userId
    });
    def.then(function(data){
        layer.close(loadingIndex);
        data.code == 1 ? initProfitData(data.data): toast(data.msg);
    });
}

// 获取月盈利信息
function getMonthProfit(date){
    var str = date.replace(/-/g, '/') + '/1';
    $('.chart-time').text(new Date(str).pattern('yyyy年MM月'));
    var loadingIndex = loading();

    $('.piechart-content, .linechart-content').removeClass('active');
    var userId = getQueryString('userid') || 0;
    var def = reqAjax('earnmoney/getMonthProfitReport', {
        userId: userId,
        selectDate: date
    });
    def.then(function(data){
        layer.close(loadingIndex);
        data.code == 1 ? initProfitMonthData(data.data, date): toast(data.msg);
    });
    return def;
}

// 重新获取账单列表
function reloadBillList(){
    $('.bill-content .search-list').remove();
    $('.load-more').html('<span class="loading"></span> 加载中...');
    hasData = true;
    // 设置分类名称
    var txt = $('.category-content .category-item.active').text();
    $('.icon-select.icon-category>span').text(txt.replace(/\s/g, ''));
    getBillList();
}

// 获取账单列表
// type：0-全部，1-抢标赚，2-转文赚，3-分享赚
function getBillList(){
    if (isLoading) return;
    if(!hasData) return;

    isLoading = true;
    setTimeout(function(){
    	isLoading = false;
    },2000);

    var date = $('#dateSelected').attr('value');
    var d = new Date(date.replace(/-/g, '/')+'/1');
    $('.search-time, .icon-time>span').text(d.pattern('yyyy年MM月'));
    
    var rows = 10;
    var page = parseInt($('.bill-content .search-list').length/rows) + 1;
    var type = $('.category-item.active').attr('value');
    var userId = getQueryString('userid') || 0;

    var def = reqAjax('earnmoney/getProfitDetailNew', {
        userId: userId,
        selectDate: date,
        selectType: type,
        pagination: {
            page: page || 1,
            rows: rows || 10
        }
    });
    def.then(function(data){
        if(data.code != 1) return toast(data.msg);
        initBillListData(data.data)
        // 处理全局数据
        var total = data.total;
        hasData = $('.bill-content .search-list').length < total;
        isLoading = false;
        if(!hasData) {
            $('.load-more').text('没有更多数据了……');
        }
    });
    return def;
}

// 获取url中的参数
function getQueryString(name){
    var reg = new RegExp("(^|&)" + name + "=([^&]*)(&|$)");
    var r = window.location.search.substr(1).match(reg);
    return r !== null ? decodeURI(r[2]) : null;
}
// 提示语句
function toast(msg){
    return layer.open({type: 0,content: msg, style:"color:#fff;background-color:rgba(0,0,0,0.7);font-size:14px;letter-spacing: 1px;", shade:"background-color:rgba(0,0,0,0.1)"})
}

// 加载状态
function loading(msg){
    return layer.open({type: 2})
}
// 通用ajax调用
function reqAjax(cmd, data){
    var deferred = $.Deferred();
    $.ajax({
        type:"post",
        dataType: 'json',
        url:"/zxcity_restful/ws/rest",
        headers: {
            apikey: sessionStorage.getItem('apikey') || 'test'
        },
        data: {
            cmd: cmd,
            data: JSON.stringify(data),
            version: 2 // 版本号根据情况默认
        },
        success: function(data){
            deferred.resolve(data)
        },
        error: function(){
            // 这里的 error 一般都是网络问题，500了也检查不出来
            $('.content').css({'display':'none'});
            $('.fail_load').css({'display':'block'});
            setTimeout(function(){
            	layer.closeAll('loading');
            },1000);
           	
            // toast('连接出错，请检查网络或稍后再试！');
            deferred.reject()
        }
    });
    return deferred;
}

// 初始化时间选择器
function initTimeSelector(){
    // 设置时间选项，由大到小
    var date = new Date();
    // 这个是五个的时间选择
    $('.chart-layer .time-item').each(function(){
        $(this).text(date.pattern('yyyy 年 MM 月'));
        $(this).attr('value', date.pattern('yyyy-MM'));
        date.setMonth(date.getMonth() - 1);
    });
    // 以下是正式的时间选择
    var year = new Date().getFullYear();
    for(var i=0; i<10; i++) {
        var $div = $('<div class="items year_items"></div>').text(year + '年').attr('value', year);
        if(i == 0) $div.addClass('active');
        $('.year-content').append($div)
        year--;
    }
    var month = new Date().getMonth() + 1;
    for(var i=12; i>0; i--) {
        var $div = $('<div class="items month_items"></div>').text(i + '月').attr('value', i);
        if(month == i) $div.addClass('active');
        $('.month-content').append($div);
    }

    // 高度单位
    var itemHeight = Math.floor($('.items').height() + 0.5);
    // 下拉位移
    var down_y = itemHeight * 2;
    $('.year-content, .month-content').css('transform', 'translate3d(0, '+ down_y +'px, 0)');

    setSelectedDate(true)
    // 手指拖动
    var moveY = 0;
    var transformY = 0;
    var hasMoved = false;
    $('.year-content, .month-content').on('touchstart touchmove touchend', function(e){
        // 按下时记录距离
        if(e.type == 'touchstart') {
            moveY = e.originalEvent.touches[0].pageY;
            transformY = parseInt($(this).css('transform').split(/,|\)/)[5]) || 0;
            $(this).removeClass('transition');
            hasMoved = false;
        } else if (e.type == 'touchend'){
            moveY = 0;
            // 开始放开时的回弹效果
            $(this).addClass('transition');
            // 当前位移
            var y = parseInt($(this).css('transform').split(/,|\)/)[5]) || 0;

            // 若未滑动，只是点击
            if(!hasMoved) {
                var $item = $(e.target);
                if($item.hasClass('items')) {
                    y = (2 - $item.index()) * itemHeight
                }
            }
            
            // 最大上拉位移
            var up_y = itemHeight * 3 - $(this).height();
            // 大于两个单位，则回退到两个单位
            if(y > down_y) {
                y = down_y;
                $(this).css('transform', 'translate3d(0, '+ down_y +'px, 0)');
                var index = Math.abs(Math.floor(y/itemHeight)-2);
                $(this).find('.items:visible').removeClass('active').eq(index).addClass('active');
            } else if (y < up_y) {
                y = up_y;
                $(this).css('transform', 'translate3d(0, '+ y +'px, 0)');
                $(this).find('.year_items:visible').removeClass('active').eq(9).addClass('active');
                $(this).find('.month_items:visible').removeClass('active').eq(11).addClass('active');
            } else {
                y = Math.floor(y/itemHeight + 0.5) * itemHeight;
                $(this).css('transform', 'translate3d(0, '+ y +'px, 0)');
                var index = Math.abs(Math.floor(y/itemHeight)-2);
                $(this).find('.items:visible').removeClass('active').eq(index).addClass('active');
            }
            setSelectedDate(false)
        } else {
            hasMoved = true;
            // 拖动时跟着移动
            var _y = e.originalEvent.touches[0].pageY - moveY;
            $(this).css('transform', 'translate3d(0, '+ (transformY + _y) +'px, 0)');
        }
    });
    $('.category-layer-content').on('touchend', function(e){
        e.preventDefault();
        e.stopPropagation();
    });
}

// 设置选中时间
// true，设置值到value
function setSelectedDate(flag){
    var year = $('.year-content .items.active').attr('value');
    var month = $('.month-content .items.active').attr('value');
    var dateStr = new Date(year + '/' + month + '/1').pattern('yyyy-MM');
    $('#dateSelected').text(dateStr);
    if(flag) $('#dateSelected').attr('value', dateStr);
}

// 根据值，重设时间
function resetSelectedDate(){
    var val = $('#dateSelected').attr('value');
    var date = new Date(val.replace(/-/g, '/') + '/1');
    $('#dateSelected').text(date.pattern('yyyy-MM'));

    var year = date.getFullYear();
    var month = date.getMonth() + 1;
    
    var yearItem = $('.year-content .items[value="'+year+'"]');
    var monthItem = $('.month-content .items[value="'+month+'"]');

    yearItem.addClass('active').siblings().removeClass('active');
    monthItem.addClass('active').siblings().removeClass('active');
    var itemHeight = Math.floor($('.items').height() + 0.5);
    $('.year-content').css('transform', 'translate3d(0, '+ (2 - yearItem.index())*itemHeight +'px, 0)');
    $('.month-content').css('transform', 'translate3d(0, '+ (2 - monthItem.index())*itemHeight +'px, 0)');
}

// 初始化盈利数据
function initProfitData(data){
    $('#totalProfit').text(formatMoney(data.totalProfit));
    $('#onlineProfit').text(formatMoney(data.onlineProfit));
    $('#offlineProfit').text(formatMoney(data.offlineProfit));
}

// 表格数据
function initProfitMonthData(data, date){
    $('#monthTotalProfit').text(formatMoney(data.monthTotalProfit));
    var fxzProfit = data.monthSProfit;
    var qbzProfit = data.monthTProfit;
    var zwzProfit = data.monthRProfit;
    $('.piechart-content, .linechart-content').addClass('active');
    setPiechart([fxzProfit, qbzProfit, zwzProfit]);
    setLinechart(data.moreMonthPInfo, date);
}

// 设置账单数据
function initBillListData(data){
    $('#monthProfit').text(formatMoney(data.monthProfit));
    
    var arr = data.profitList;
    $('.bill-content').append();
    for(var i=0; i<arr.length; i++){
        var $dom = $($('#detailTpl').html());
        var title = arr[i].taskTitle || '';
        // 1-抢标赚，2-转文赚，3-分享赚
        if(arr[i].profitType == 1){
            $dom.addClass('qbz');
            $dom.find('.type-text').text('抢标赚');
            title = '需要“'+ title + '”';
        } else if (arr[i].profitType == 2) {
            $dom.addClass('zwz');
            $dom.find('.type-text').text('转文赚');
            title = '分享“'+ title + '”';
        } else {
            $dom.addClass('fxz');
            $dom.find('.type-text').text('分享赚');
        }
        $dom.find('.sharenum').text(arr[i].sharenum);
        $dom.find('.clicknum').text(arr[i].clicknum);
        $dom.find('.taskTitle').text(title.length > 10 ? title.substr(0, 10) + '...': title );
        $dom.find('.finishTime').text(arr[i].finishTime);
        $dom.find('.taskPrice').text('+'+ formatMoney(arr[i].taskPrice));

        $('.load-more').before($dom);
    }
}

Date.prototype.pattern=function(fmt) {
    var o = {         
        "M+" : this.getMonth()+1, //月份
        "d+" : this.getDate(), //日 
        "h+" : this.getHours()%12 == 0 ? 12 : this.getHours()%12, //小时 
        "H+" : this.getHours(), //小时
        "m+" : this.getMinutes(), //分
        "s+" : this.getSeconds(), //秒 
        "q+" : Math.floor((this.getMonth()+3)/3), //季度
        "S" : this.getMilliseconds() //毫秒 
    };
    if(/(y+)/.test(fmt)){
        fmt=fmt.replace(RegExp.$1, (this.getFullYear()+"").substr(4 - RegExp.$1.length));
    }
    for(var k in o){
        if(new RegExp("("+ k +")").test(fmt)){
            fmt = fmt.replace(RegExp.$1, (RegExp.$1.length==1) ? (o[k]) : (("00"+ o[k]).substr((""+ o[k]).length)));
        }
    }
    return fmt;
}

window.allowScroll = function(){
    return !document.querySelector('.all-layer').classList.contains('active');
};
// 检测能否移动
window.checkScroll = function(e){
    return false;
}
window.setPiechart = setPiechart